    }
  render() {
    return (
      <div className='container my-2'>
        <h2>Top Headlines</h2>
        
        <div className="row">
        {this.state.articles.map((element)=>{
           <div className="col-md-4">
           <NewsComponent title="this is title" description="description" imageUrl=""/>
       </div> 
        })}
            
    
        </div>
      
      </div>
    )
  }
}

export default News
